import React from "react";

const DataList = ({ data, index, nomarticle }) => {
  var dataList = [];
  data.map((element) =>
    dataList.push({
      id: element.idarticle,
      value: element.nom_article,
    })
  );

  const button = () => {};

  return (
    <div key={index}>
      <input
        type="text"
        list="datalist"
        onChange={button}
        ref={(element) => {
          nomarticle.current[index] = element;
        }}
      />
      <datalist id="datalist">
        {dataList.map((item, key) => (
          <option key={key} value={item.value}>
            {item.value}
          </option>
        ))}
      </datalist>
    </div>
  );
};

export default DataList;
